contracts/HelloWorld3.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

contract GuessNumber {
    address public player;
    uint public randomNumber;
    bool public isGameFinished;

    event LogMessage(string message);

    constructor() {
        player = msg.sender;
        randomNumber = generateRandomNumber();
        isGameFinished = false;
    }

    modifier onlyPlayer() {
        require(msg.sender == player, "Only the player can perform this action");
        _;
    }

    modifier gameNotFinished() {
        require(!isGameFinished, "The game is already finished");
        _;
    }

    function generateRandomNumber() private view returns (uint) {
        return uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty, blockhash(block.number - 1)))) % 100;
    }

    function guess(uint _number) public onlyPlayer gameNotFinished {
        require(_number >= 0 && _number <= 99, "Number out of range");

        if (_number == randomNumber) {
            isGameFinished = true;
            emit LogMessage("Congratulations! You guessed the number correctly!");
        } else {
            emit LogMessage("Sorry, your guess is incorrect. Try again!");
        }
    }

    function getHint() public view onlyPlayer gameNotFinished returns (string memory) {
        if (randomNumber > 50) {
            return "The number is greater than 50";
        } else {
            return "The number is less than or equal to 50";
        }
    }
}

